import * as React from 'react';

import { HEADER_MENU } from './header-menu';

export default class Header extends React.Component<{}, {}> {
  public createMenu = () => {
    const menu = [];
    for (const item of HEADER_MENU.items) {
      menu.push(
          <li className="Header__menu-item" key={item.id}>
            <a href={item.to} className="Header__link">
              {item.name}
            </a>
          </li>
      );
    }
    return menu;
  };

  public render() {
    return (
        <header className="Header">
          <div className="Header__container">
            <div className="Header__container__content">
              <h1 className="Header__container__content__logo-box">
                <a href="/">
                  <img
                      className="Header__container__content__logo"
                      src="https://wohnservice-wien.at/fileadmin/user_upload/Logos/logo_wienerwohnen_500x375.png"
                      alt="Wiener Wohnen Logo"
                  />
                </a>
              </h1>
            </div>
          </div>
          <nav className="Header__menu">
            <ul className="Header__menu-list">{this.createMenu()}</ul>
          </nav>
          <div className="Header__decoration" />
        </header>
    );
  }
}
